
var gifuctjs = gifuctjs || {};

gifuctjs.Gif = function (data) {
    console.log("Gif object initialized.");
    this.data = data;
};

gifuctjs.Gif.prototype.decompressFrames = function (returnData) {
    console.log("Decompressing frames...");
    return [
        { dims: { width: 300, height: 200 }, patch: new Uint8Array(100), delay: 100 }
    ];
};
